    stack = []
    for char in paren_string:
        if char == '(':
            stack.append(char)
        elif char == ')':
            while stack and stack[-1] == '(':
                stack.pop()
            if not stack:
                result.append(char)
        else:
            stack.append(char)
    while stack:
        stack.pop()
    return result

