""" brackets is a string of "<" and ">".
    return True if every opening bracket has a corresponding closing bracket.
    """
    stack = []
    for bracket in brackets:
        if bracket == "<":
            stack.append("<")
        elif bracket == ">":
            if len(stack) == 0:
                return False
            stack.pop()
    return len(stack) == 0

""" brackets is a string of "<" and ">".
    return True if every opening bracket has a corresponding closing bracket.

    >>> correct_bracketing("<")
    False
    >>> correct_bracketing("<>")
    True
    >>> correct_bracketing("<<><>>")
    True
    >>> correct_bracketing("><<>")
    False
    """ 
    stack = []
    for bracket in brackets:
        if bracket == "<":
            stack.append("<")
        elif bracket == ">":
            stack.append(">")
        elif bracket == "[":
            stack.append("[")
        elif bracket == "]":
            stack.append("]")
        elif bracket == "(":
            stack.append("(")
        elif bracket == ")":
            stack.append(")")
        elif bracket == "<-":
            stack.pop()
        elif bracket == ">-":
            stack.pop()
        elif bracket == "<->":
            stack.pop()
    return len(stack) == 0

